import React from 'react';
// import PropTypes from 'prop-types';

export default function Message() {
  return (
    <Container fluid className="mt--7">
      <Row>
        <Col>
          <Card>
            <CardHeader>
              <CardTitle tag="h4">Simple Table</CardTitle>
            </CardHeader>
            <CardBody>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

Message.propTypes = {};
Message.defaultProps = {};
